import { React, useState } from "react";
import { Link } from "react-router-dom";
import "./Naslovna.css";
const Naslovna = () => {
  const [predmeti, setPredmeti] = useState([
    { naziv: "asd", id: 1 },
    { naziv: "sadasd", id: 2 },
    { naziv: "asdasdasdsa", id: 3 },
  ]);
  return (
    <ul id="predmeti">
      <Link to="">
        <li className="predmet">PREDMET</li>
      </Link>
      <li className="predmet">PREDMET</li>
      <li className="predmet">PREDMET</li>
      <li className="predmet">PREDMET</li>
      <li className="predmet">PREDMET</li>
    </ul>
  );
};

export default Naslovna;
